import './App.css';

function App() {
  return (
    <main>
      <h1>$400<span>.00</span></h1>
      <input type="text" placeholder="Transaction" />
      <input type="number" placeholder="Amount" />
      <input type="datetime-local" />
      <input type="text" placeholder="Description" />
    </main>
  );
}

export default App;
